INSERT INTO `catalog_product_entity_text` VALUES (89,4,72,0,7,'<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif;\">Es la combinaci&oacute;n perfecta de caf&eacute; Colombiano e Indonesio con un aroma exuberante que le deleitara, enriquecido nutrientes que con la sinergia de los mismos son notables los beneficios que aporta a su salud al tomar la primer taza de caf&eacute;. </span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif;\">Donde a trav&eacute;s de sus h&aacute;bitos logra obtener <span style=\"text-decoration: underline;\"><strong>energ&iacute;a, salud y bienestar general. </strong></span></span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif;\">No contiene az&uacute;car ni leche, recomendado para personas diabeticas.</span></p>\r\n<p><strong><em><span style=\"font-family: tahoma, arial, helvetica, sans-serif;\">&icirc;Preparelo a su gusto!</span></em></strong></p>\r\n<p><span style=\"color: #808000;\"><em><span style=\"font-family: tahoma, arial, helvetica, sans-serif;\">&nbsp;<strong>El beber caf&eacute; de H&aacute;bitos Saludables es una experiencia &uacute;nica y refrescante.</strong></span></em></span></p>'),(90,4,73,0,7,'<p><span>Es la combinaci&oacute;n perfecta de caf&eacute; Colombiano e Indonesio con un aroma exuberante que le deleitara, enriquecido nutrientes que con la sinergia de los mismos son notables los beneficios que aporta a su salud al tomar la primer taza de caf&eacute;.</span></p>\r\n<p><span>Donde a trav&eacute;s de sus h&aacute;bitos logra obtener&nbsp;<span><strong>energ&iacute;a, salud y bienestar general.</strong></span></span></p>\r\n<p><span>No contiene az&uacute;car ni leche.</span></p>\r\n<p><span style=\"color: #008000;\"><em>&nbsp;<strong>El beber caf&eacute; de H&aacute;bitos Saludables es una experiencia &uacute;nica y refrescante.</strong></em></span></p>'),(91,4,83,0,7,NULL),(92,4,106,0,7,NULL),(93,4,72,0,8,'<p><span>Es la combinaci&oacute;n perfecta 