sp;desde hace m&aacute;s de 25 a&ntilde;os.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-large;\"><br /></span></p>\r\n<h1><strong><span style=\"font-size: xx-large; color: #004700;\">NUESTRA MISI&Oacute;N</span></strong></h1>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-large;\"><span style=\"text-align: justify;\">Nuestra misi&oacute;n es </span><span style=\"color: #008000;\"><strong>crear una oportunidad</strong></span><span style=\"text-align: justify;\"> donde la gente de todas las clases sociales puedan participar y </span><span style=\"color: #008000;\"><strong>crear un ingreso inmediato</strong></span><span style=\"text-align: justify;\">, as&iacute; como </span><span style=\"color: #008000;\"><strong>un ingreso mensual residual a largo plazo</strong></span><span style=\"text-align: justify;\"> ofreciendo </span><span style=\"color: #008000;\"><strong>productos que superan los est&aacute;ndares de la industria</strong>.</span><span style=\"text-align: justify;\"> Siempre vamos a basarnos en las decisiones corporativas y ejecutivas a favor de nuestros distribuidores y clientes.</span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-large;\"><span style=\"text-align: justify;\"><br /></span></span></p>\r\n<h1 class=\"entry-content\"><span style=\"font-size: xx-large;\"><strong><span style=\"color: #004700;\">PROPOSITO</span></strong></span></h1>\r\n<div class=\"entry-content\"><span style=\"font-size: xx-large;\"><strong><span style=\"color: #004700;\"><br /></span></strong></span></div>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-large;\">Desarrollar <span style=\"color: #008000;\"><strong>relaciones a largo plazo con nuestros clientes y distribuidores</strong></span> en base al valor excepcional de nuestros productos y la atenci&oacute;n personal que reciben. Tambi&eacute;n estamos <strong><span style=\"color: #008000;\">comprometidos a ofrecer un plan de compensaci&oacute;n que mejorara la capacidad del individuo</span> </strong>para ganar un ingreso razonable de tiempo parcial, as&iacute; como la capacidad de <strong><span style=\"color: #008000;\">lograr la independencia financiera con un esfuerzo a tiempo completo.</span>&nbsp;</strong></span></p>\r\n<h3>&nbsp;</h3>\r\n<div id=\"g1-divider-counter-2\" class=\"g1-divider g1-type-simple\">&nbsp;</div>\r\n<h1><strong><span style=\"font-size: xx-large;\">Equipo Ejecutivo</span></strong></h1>\r\n<p><span style=\"font-size: x-large;\"><img src=\"{{media url=\"wysiwyg/Logo-completo.png\"}}\" alt=\"CLOUD\" />&nbsp; <span style=\"color: #000000;\">&nbsp;Cloud &amp; Web Solutions&nbsp;<span style=\"font-size: large;\"><em>*Sistemas Web*</em></span></span></span></p>\r\n<p><span style=\"font-size: x-large;\"><br /></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-large; color: #000000;\">Empresa mexicana creada por j&oacute;venes empresarios dedicados y apasionados por las tecnolog&iacute;as de informaci&oacute;n y comunicaci&oacute;n. Creemos que cada proyecto representa una oportunidad para demostrar la capacidad y entusiasmo de la empresa para con el cliente. Trayendo siempre lo mejor de nuestra experiencia y conocimiento para la creaci&oacute;n de un producto &uacute;nico y diferenciado.</span></p>\r\n<p><span style=\"color: #000000;\">&nbsp;</span></p>\r\n</div>','2014-09-04 22:55:37','2014-10-24 22:50:32',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(14,'Horario de llamadas','single_page',NULL,NULL,'horario-de-llamadas',NULL,'<div class=\"main-banner-holder\"><img src=\"{{media url=\"wysiwyg/contacto/banner_contactanos_hs_2014.jpg\"}}\" alt=\"\" /></div>\r\n<div class=\"row\">\r\n<div class=\"separator-shadow\">&nbsp;</div>\r\n</div>\r\n<div class=\"main-banner-holder\"><span style=\"font-size: x-large;\"><br /></span></div>\r\n<div class=\"main-banner-holder\"><span style=\"font-size: x-large;\">Estamos a sus ordenes al Telefono <span style=\"font-size: xx-l