ago.</span></div>\r\n<div class=\"main-banner-holder\" style=\"text-align: justify;\"><span style=\"font-size: large;\">A nosotros nos llegara la informacion de su compra y se realizara el envio o entrega en tienda segun haya seleccionado.</span></div>\r\n<div class=\"main-banner-holder\" style=\"text-align: justify;\"><span style=\"font-size: large;\">Para una explicacion mas detallada de <a href=\"http://magento.cloudandweb.com/media/informacion/como-pagar-oxxo.pdf\" target=\"_blank\">click</a> aqui.</span></div>','2014-09-04 23:37:33','2014-10-28 23:37:29',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(16,'Testimoniales','single_page',NULL,NULL,'testimoniales',NULL,'<div class=\"main-banner-holder\"><img src=\"{{media url=\"wysiwyg/contacto/banner_testimonios_hs_2014.jpg\"}}\" alt=\"\" /></div>\r\n<div class=\"row\">\r\n<div class=\"separator-shadow\">&nbsp;</div>\r\n</div>\r\n<div class=\"container\">\r\n<p><span style=\"font-size: x-large;\"><strong><em>Eva Eguino Castillo</em></strong> - Tijuana, B.C., Mexico-</span></p>\r\n<p><span style=\"font-size: large; text-align: justify;\">\"Mi testimonio es que al tomar el Te Chai Gourmet por las primeras tres semanas empeze a notar mejoria en mis cambios hormonales y quistes en los ovarios con abundante sangrado que habia tenido por 5 meses y ningun medicamente, ni producto me lo habia disminuido.El Te Chai Gourmet me hizo el milagro de que se me quitara el sangrado abundante ocasinado por los quistes y tumores que padezco desde hace 17 a&ntilde;os, de igual manera me ayudo a salvarme de una segunda operacion. Los invito a consumirlo\"</span></p>\r\n</div>','2014-09-04 23:46:08','2014-10-29 00:05:00',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(17,'Unirse','single_page',NULL,NULL,'unirse',NULL,'<div class=\"container\">\r\n<div class=\"content\">\r\n<h2>Comenzar tu negocio con nosotros es muy sencillo!</h2>\r\n<p><span style=\"font-size: medium; color: #008000;\"><em><strong>Ten a la mano&nbsp;la clave de tu Patrocinador&nbsp;</strong><